'use strict';

export var scriptProperties = createScriptProperties()
	.addSlider({
		name: 'GlobalSpeed',
		label: 'globalspeed',
		value: 3,
		min: 0,
		max: 10,
		integer: false
	})
	.finish();

var timerTime = 250;
var timer = 0;
var step = 0;
var dynamicSpeed = 0.5;

export function init(value) 
{
	shared = 0;
	return value;
}

export function update(value) 
{
	timer += (scriptProperties.GlobalSpeed * dynamicSpeed) * engine.frametime;
	if(timer >=timerTime)
	{
		dynamicSpeed = 0.5;
		timer=0;
		step++;
		if(step == 1 || 4)
			timer+=timerTime/4;
		if(step == 6)
			step = 0;
		shared = step;
	}
	dynamicSpeed+=0.5;
	return value;
}

