'use strict';

export var scriptProperties = createScriptProperties()
	.addSlider({
		name: 'GlobalSpeed',
		label: 'globalspeed',
		value: 3,
		min: 0,
		max: 10,
		integer: false
	})
	.finish();

var step = 0;
var completedStep = -1;
var dynamicSpeed = 0.5;

export function update(value)
{
	step=shared;
	if(step == completedStep)
		return value;

	switch (step) 
	{
		case 0:
			onCompleteStep();
		case 1:
			value.y += (scriptProperties.GlobalSpeed * dynamicSpeed) * engine.frametime;
			if(value.y > 0)
			{
				value.x = 90;
				value.y = 0;
				value.z = -90;
				onCompleteStep();
			}	
			break;
		case 2:
			value.z -= (scriptProperties.GlobalSpeed * dynamicSpeed) / 2 * engine.frametime;
			if(value.z < -180)
			{
				value.x = 90;
				value.y = 0;
				value.z = 180;
				onCompleteStep();
			}	
			break;
		case 3:
			value.x -= (scriptProperties.GlobalSpeed * dynamicSpeed) * engine.frametime;
			if(value.x < -90)
			{
				value.x = -90;
				value.y = 0;
				value.z = 180;
				onCompleteStep();
			}	
			break;
		case 4:
			value.z -= (scriptProperties.GlobalSpeed * dynamicSpeed) * engine.frametime;
			if(value.z < 90)
			{
				value.x = -90;
				value.y = 0;
				value.z = 90;
				onCompleteStep();
			}	
			break;
		case 5:
			value.y -= (scriptProperties.GlobalSpeed * dynamicSpeed) / 2 * engine.frametime;
			if(value.y < -90)
			{
				value.x = 90;
				value.y = -90;
				value.z = -90;
				onCompleteStep();
			}	
			break;
	}
	dynamicSpeed+=0.5;
	return value;
}

function onCompleteStep()
{
	completedStep=step;
	dynamicSpeed=0.5;
}

