'use strict';

export var scriptProperties = createScriptProperties()
	.addSlider({
		name: 'GlobalSpeed',
		label: 'globalspeed',
		value: 3,
		min: 0,
		max: 10,
		integer: false
	})
	.finish();

var step = 0;
var completedStep = -1; 
var curentAngle = 90;
var curentSecondAngle = 135;
var dynamicSpeed = 0.5;


export function update(value) 
{
	step=shared;
	if(step == completedStep)
		return value;

	switch (step) 
	{
		case 0:
			onCompleteStep(45);
			break;
		case 1:
			curentAngle-=(scriptProperties.GlobalSpeed * dynamicSpeed) * engine.frametime;
			value.z = (angleCos(curentAngle, 1.06066017)) + 0.25;
			if(curentAngle < -45)
			{
				value.z = 1;
				onCompleteStep(45, 0);
			}	
			break;
		case 2:
			curentAngle-=(scriptProperties.GlobalSpeed * dynamicSpeed) / 2 * engine.frametime;
			value.x = angleCos(curentAngle, 1.06066017) + 0.25;
			value.y = angleSin(-curentAngle+45, 1.4142135624*1.4142135624)-1;
			if(curentAngle < -45)
			{
				value.x = 1;
				value.y = 1;
				onCompleteStep(90, 135);
			}	
			break;
		case 3:
			curentAngle-=(scriptProperties.GlobalSpeed * dynamicSpeed) / 2 * engine.frametime;
			curentSecondAngle-=(scriptProperties.GlobalSpeed * dynamicSpeed) * engine.frametime;
			value.y = (angleSin(curentAngle, 0.5) - 0.25) + angleSin(curentSecondAngle, 1.06066017);
			value.z = (angleCos(curentAngle, 0.5) + 1.75) + angleCos(curentSecondAngle, 1.06066017);
			if(curentAngle <= 0)
			{
				value.y = -1;
				value.z = 3;
				onCompleteStep(45, 0);
			}
			break;
		case 4:
			curentAngle-=(scriptProperties.GlobalSpeed * dynamicSpeed) * engine.frametime;
			value.x = (angleCos(curentAngle, 1.06066017)) + 0.25;
			if(curentAngle < -45)
			{
				value.x = 1;
				onCompleteStep(90, 0);
			}	
			break;
		case 5:
			curentAngle-=(scriptProperties.GlobalSpeed * dynamicSpeed) / 2 * engine.frametime;
			value.z = angleSin(curentAngle, 1.4142135624*1.4142135624)+1+angleSin(curentAngle*2, 0.25);
			if(curentAngle < 0)
			{
				value.z = 1;
				value.y = -1;
				onCompleteStep(90, 135);
			}	
			break;
	}
	dynamicSpeed+=0.5;
	return value;
}

function angleCos(angle, radius)
{
	return (Math.cos(angle * (Math.PI / 180)) * radius);
}
function angleSin(angle, radius)
{
	return (Math.sin(angle * (Math.PI / 180)) * radius);
}

function onCompleteStep(newAngle, newSecondAngle)
{
	curentAngle = newAngle;
	curentSecondAngle = newSecondAngle;
	completedStep=step;
	dynamicSpeed=0.5;
}

